// add color to top N artists
// sort by value key
artist_nodes.sort(function(a,b){
  if( a.value > b.value ) return -1;
  if( a.value < b.value ) return 1;
  return 0;
});

const top_N = 30;
const hsv_s = 0.7;
const hsv_v = 0.8;
for (let i = 0; i < top_N; i++){
  artist_node = artist_nodes[i];
  const hsv_h = 360/top_N * i;
  const color = chroma.hsv( hsv_h, hsv_s, hsv_v ) ;
  artist_node['color'] = color.hex();
}
nodes = new vis.DataSet(title_nodes.concat(artist_nodes));

function keypress_search(code){
  if(13 === code){
    btn_search();
  }
}

function btn_search(){
  const artist = document.getElementById('text_search').value;
  if (artist){
    const result = artist_nodes.find((v) => v.id.indexOf(artist) > -1);
    if (result){
      network.focus(result.id, {animation: true});
      network.selectNodes([result.id]);
    }
  }
}

function draw() {
  // create people.
  // value corresponds with the age of the person

  // Instantiate our network object.
  var container = document.getElementById('network');
  
  var data = {
    nodes: nodes,
    edges: edges
  };
  var options = {
    nodes: {
      shape: 'dot',
      scaling: {
        min:3,
        max:30,
        customScalingFunction: function (min,max,total,value) {
          if (max === min) {
            return 0.5;
          }
          else {
            var scale = 1 / (Math.pow(max,0.5) - Math.pow(min,0.5));
            return Math.max(0,(Math.pow(value,0.5) - Math.pow(min,0.5))*scale);
          }
        },
        label: {
          enabled: true,
          min: 8,
          max: 30,
        },
      },
      font: {
        strokeWidth: 2,
      },
    },
    layout: {
      improvedLayout:false,
    },
    edges: {
        color: {
            inherit: 'from',
            opacity: 0.5,
        },
        scaling: {
          min: 1,
          max: 15,
        },
    },
    groups: {
        series: {
            'label': '',
            'size': 80,
            'shape': 'image',
        },
    },
        
  };
  network = new vis.Network(container, data, options);

  network.on("stabilizationProgress", function (params) {
    var maxWidth = 496;
    var minWidth = 20;
    var widthFactor = params.iterations / params.total;
    var width = Math.max(minWidth, maxWidth * widthFactor);

    document.getElementById("bar").style.width = width + "px";
    document.getElementById("text").innerHTML =
      Math.round(widthFactor * 100) + "%";
  });
  network.once("stabilizationIterationsDone", function () {
    document.getElementById("text").innerHTML = "100%";
    document.getElementById("bar").style.width = "496px";
    document.getElementById("loadingBar").style.opacity = 0;
    // really clean the dom element
    setTimeout(function () {
      document.getElementById("loadingBar").style.display = "none";
    }, 500);
  });

  //選択されたエッジ以外を不可視化する。
  network.on('selectEdge', function(params){
    
    const selected_ids = params['edges'];
    const all_ids = edges.getIds();
    let updated_edges = [];
    for (let id of all_ids){
      //選択idに一致したら抜ける
      if (selected_ids.includes(id)){
        continue;
      }
      const edge = edges.get(id);
      edge.hidden = true;
      updated_edges.push(edge);
      
      //console.log(id);
    }
    //まとめてアップデート(ひとつひとつアップデートすると非常に遅い)
    edges.update(updated_edges);
    //console.log('selectEdge:',ids);

    //エッジにつながっていないノードを半透明にする
    let updated_nodes = [];
    //つながったノードを抽出
    let connected_nodeids = [];
    for (let id of selected_ids){
      const nodeids = network.getConnectedNodes(id);
      connected_nodeids = connected_nodeids.concat(nodeids);
    }

    //つながっていないノードを抽出
    const all_nodeids = nodes.getIds();
    for (let id of all_nodeids){
      if (connected_nodeids.includes(id)){
        continue;
      }
      const node = nodes.get(id);
      node.opacity = 0.2;
      updated_nodes.push(node);

    }
    nodes.update(updated_nodes);

  });
  //選択解除されたら表示を元に戻す
  network.on('deselectEdge', function(params){
    //console.log('deselectEdge:', params);
    //選択解除されたら全部を可視化
    const all_ids = edges.getIds();
    let updated_edges = [];
    for (let id of all_ids){
      const edge = edges.get(id);
      edge.hidden = false;
      updated_edges.push(edge);
    }
    //まとめてアップデート(ひとつひとつアップデートすると非常に遅い)
    edges.update(updated_edges);

    //半透明にしたノードを元に戻す
    const all_nodeids = nodes.getIds();
    let updated_nodes = [];
    for (let id of all_nodeids){
      const node = nodes.get(id);
      node.opacity = 1;
      updated_nodes.push(node);
    }
    nodes.update(updated_nodes);
  });

}